const Cv = ({tasks,seconds}) => {


  return (
    <>
    <div key={tasks.count} >
        <div className='name' >
            {tasks.text}
            </div>
            <div className='name'>
            {tasks.tel}
            </div>
            <div className='name'>
            {tasks.email} 
            </div>


        <div style={{display:'flex',alignItems:'center',gap:'15px'}}
        key={second.count}>
              <div className='name'>
            {second.school}
            </div>
            <div className='name'>
            {second.title}
            </div>
            <div className='name'>
            {second.date}
            </div>
            <div className='name'>
            {second.finish}
            </div>
      </div>


    </div>


    </>
  );
};

export default Cv;
